import React from 'react';
import Layout from '../Layout/Layout';
import Card from '../Card/Card';

function Home() {
  return (
    <div>
      <Layout>
        <Card>
          <h1>This is home</h1>
        </Card>
      </Layout>
    </div>
  );
}

export default Home;
